            % Apertures based on 2 separate fracture surfaces
            Lcoords = G.nodes.coords(fnodes(:, 1), :); 
            Rcoords = G.nodes.coords(fnodes(:, 2), :);
            [z2l(i), jrcl(i)] = JRCtse(Lcoords(:, 1), Lcoords(2, 2)- Lcoords(1, 2), 1);
            [z2r(i), jrcr(i)] = JRCtse(Rcoords(:, 1), Rcoords(2, 2)- Rcoords(1, 2), 1);
            z2a(i)  = 0.5*(z2l(i)  + z2r(i));  % average
            jrca(i) = 0.5*(jrcl(i) + jrcr(i)); % average            
            
            
            fprintf('i: %d\n', i);
            
            
        end
        
        
